{"object_type": "TweetRaw", "download_datetime": "2022-09-16T16:58:38.697153+08:00", "raw_value": {"created_at": "Fri Sep 16 02:26:09 +0000 2022", "id": 1570599892627894272, "id_str": "1570599892627894272", "full_text": "Ukrainians take the long view.\n\nThe Russian Federation invaded Ukraine in 2014.\n\nSoviet Russia invaded Ukraine in 1944.\n\nBolshevik Russia invaded Ukraine in 1918.\n\nThe Russian Empire and Principality of Muscovy invaded Ukraine for centuries before that.\n\nAnd Ukraine endures.", "truncated": false, "display_text_range": [0, 275], "entities": {"hashtags": [], "symbols": [], "user_mentions": [], "urls": []}, "source": "<a href=\"http://twitter.com/download/iphone\" rel=\"nofollow\">Twitter for iPhone</a>", "in_reply_to_status_id": null, "in_reply_to_status_id_str": null, "in_reply_to_user_id": null, "in_reply_to_user_id_str": null, "in_reply_to_screen_name": null, "user_id": 2415072836, "user_id_str": "2415072836", "geo": null, "coordinates": null, "place": null, "contributors": null, "is_quote_status": false, "retweet_count": 297, "favorite_count": 1664, "reply_count": 33, "quote_count": 9, "conversation_id": 1570599892627894272, "conversation_id_str": "1570599892627894272", "favorited": false, "retweeted": false, "lang": "en", "supplemental_language": null}}
