{"object_type": "TweetRaw", "download_datetime": "2022-09-16T16:58:50.168227+08:00", "raw_value": {"created_at": "Thu Sep 15 20:24:57 +0000 2022", "id": 1570508992753053698, "id_str": "1570508992753053698", "full_text": "Only after 6 months of the war, some western experts admit that #Ukraine 1) is actually fighting, and 2) have the strength to fight for years. Good. Experts finally learned something about Ukraine. However, this is exactly what I told for @Newsweek in early March.", "truncated": false, "display_text_range": [0, 264], "entities": {"hashtags": [{"text": "Ukraine", "indices": [64, 72]}], "symbols": [], "user_mentions": [{"screen_name": "Newsweek", "name": "Newsweek", "id": 2884771, "id_str": "2884771", "indices": [239, 248]}], "urls": []}, "source": "<a href=\"https://mobile.twitter.com\" rel=\"nofollow\">Twitter Web App</a>", "in_reply_to_status_id": null, "in_reply_to_status_id_str": null, "in_reply_to_user_id": null, "in_reply_to_user_id_str": null, "in_reply_to_screen_name": null, "user_id": 1314241954058833926, "user_id_str": "1314241954058833926", "geo": null, "coordinates": null, "place": null, "contributors": null, "is_quote_status": true, "quoted_status_id": 1570476769337307137, "quoted_status_id_str": "1570476769337307137", "quoted_status_permalink": {"url": "https://t.co/UsVClofjmw", "expanded": "https://twitter.com/SpencerGuard/status/1570476769337307137", "display": "twitter.com/SpencerGuard/s\u2026"}, "retweet_count": 11, "favorite_count": 70, "reply_count": 3, "quote_count": 0, "conversation_id": 1570508992753053698, "conversation_id_str": "1570508992753053698", "favorited": false, "retweeted": false, "lang": "en", "supplemental_language": null}}
